body{
font-family: 'Arial',sans-serif;
}
.font-arial{
font-family: 'Arial',sans-serif;
cursor: pointer;
}

       .main{
    height: 95vh;
    overflow: hidden;
     width: 100%;
    margin: 0 auto;
    position: relative;
}

       .cls-4,.cls-6,.cls-7,.cls-8{cursor: pointer;}
       
#controls {
    position: absolute;
    top: 10px;
    left: 10px;
    width: 50px !important;
}
.size-change {
    cursor: pointer;
    padding: 5px;
    transition: ease-in-out 0.20s;
    position: relative;
}

.size-change:hover {
    background: #676767;
    color: #fff;
}

.size-change:after {
  content: "";
  background: #afafaf;
  position: absolute;
  right: -2px;width: 1px;
  height: 145%;top: -5px;
}
.size-change:last-child:after{
  content: initial;

}
#controls svg{width:50px;}

#controls circle:hover {
    fill-opacity: 1;
}
.p_detail{     padding: 10px;
    z-index: 200;
    background: #fff;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 350px;
    height: 100vh;
    position: absolute;
    border-left: 1px solid #ccc;
    right: 0px;
    transition: ease-in-out 0.3s;
    -webkit-transition: ease-in-out 0.3s;
    transform: translate(0%, 0px);
}
.p_detail.p-hide {
    transform: translate(100%, 0px);
}
.d-none{
  display: none !important;
}
.tp{
      display: none;
    min-width: 120px;
    background-color: black;
    color: #fff;
    text-align: center;
    border-radius: 6px;
    padding: 5px 10px;
    position: absolute;
    z-index: 1;
    font-size:12px;
}

.close-detail{
   position: absolute;
    top: 10px;
    left: 10px;
    cursor: pointer;
}
.highlight{
 
    animation-duration: 1.7s;
    animation-name: blink;
    animation-iteration-count: infinite;
    -webkit-animation-duration: 1.7s;
    -webkit-animation-name: blink;
    -webkit-animation-iteration-count: infinite;
   }

   @keyframes blink {
      0% {
     
      fill:#cecece;
    }
    50%{
      
      fill:#ffffff;

    }
    100% {
     
       fill:#cecece;
    }
}
@-webkit-keyframes blink {
     0% {
     
      fill:#cecece;
    }
    50%{
      
      fill:#ffffff;

    }
    100% {
 
       fill:#cecece;
    }
}


    </style>
